-- 4. ALTER TABLE NOTES 
-- Taula idUFvella --> idUFnova
SELECT 
	N.notes_id, N.uf_id, CPE.any_academic_id, 
    ( 	SELECT unitat_pla_estudi_id 
		FROM UNITAT_PLA_ESTUDI UPE
        LEFT JOIN MODUL_PLA_ESTUDI MPE ON (MPE.modul_pla_estudi_id=UPE.modul_pla_estudi_id)
        LEFT JOIN CICLE_PLA_ESTUDI CPE2 ON (CPE2.cicle_pla_estudi_id=MPE.cicle_pla_estudi_id)
        WHERE any_academic_id=CPE.any_academic_id AND UPE.unitat_formativa_id=N.uf_id
	) AS IdUF_CPE
FROM NOTES N
LEFT JOIN MATRICULA M ON (M.matricula_id=N.matricula_id)
LEFT JOIN CURS C ON (C.curs_id=M.curs_id)
LEFT JOIN CICLE_PLA_ESTUDI CPE ON (CPE.cicle_pla_estudi_id=C.cicle_formatiu_id);
